import React from 'react';
import {renderQueDisplay} from "./quesDisplay/renderQueDisplay";

const QuesList = ({ques}) => {
	renderQueDisplay(ques);

	return (
		<ul>
			{ques.map(q => (<li key={q.id}>{q.title}</li>))}
		</ul>
	);
};

export default QuesList;
